import React, { useState } from "react";
import styled from "styled-components";
import BACKGROUND_IMAGE from "../../assets/Background.png";
import NMIMS from "../../assets/Nmims.png";
import { Button, Checkbox, Input, InputGroup } from "rsuite";
import MemberIcon from "@rsuite/icons/Member";
import EyeCloseIcon from "@rsuite/icons/EyeClose";
import VisibleIcon from "@rsuite/icons/Visible";

const Login = () => {
  const [hidden, setHidden] = useState(true);

  const Password = () => {
    setHidden(!hidden);
  };
  return (
    <Background>
      <Overlay />
      <Container>
        <Block1>
          <img src={NMIMS} alt="NMIMS logo" />
        </Block1>
        <Block2>
          <InputGroup className="inputgroup">
            <InputGroup.Addon className="icon">
              <MemberIcon />
            </InputGroup.Addon>
            <Input type="text" placeholder="Username" />
          </InputGroup>
          <InputGroup className="inputgroup">
            <InputGroup.Addon className="icon">
              {hidden ? <EyeCloseIcon /> : <VisibleIcon />}
            </InputGroup.Addon>
            <Input type={hidden ? "password" : "text"} placeholder="Password" />
          </InputGroup>
          <Checkbox onClick={Password}>Show Password</Checkbox>
          <div className="box">
            <StyledButton color="red" appearance="primary" size="lg">Login</StyledButton>
          </div>
        </Block2>
      </Container>
    </Background>
  );
};

export default Login;

const Background = styled.div`
  width: 100%;
  height: 100vh;
  background-image: url(${BACKGROUND_IMAGE});
  background-size: cover;
  background-repeat: no-repeat;
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
`;

const Overlay = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: linear-gradient(to top, rgba(0, 0, 0, 0.5), rgba(47, 49, 114, 0.7));
  animation: fade 3s infinite alternate;

  @keyframes fade {
    from {
      opacity: 0.7;
    }
    to {
      opacity: 0.9;
    }
  }
`;

const Container = styled.div`
  position: relative;
  border: 2px solid white;
  width: 90%;
  max-width: 750px;
  height: auto;
  border-radius: 10px;
  background-color: rgba(255, 255, 255, 0.9);
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  align-items: center;
  padding: 10px;

  @media (max-width: 1024px) {
    max-width: 600px;
  }

  @media (max-width: 768px) {
    flex-direction: column;
    padding: 20px 10px;
  }

  @media (max-width: 480px) {
    width: 80%;
    padding: 15px 5px;
  }
`;

const Block1 = styled.div`
  height: 90%;
  width: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
  margin-right: 20px;
  img {
    width: 250px;
    transition: transform 0.3s;
  }
  border-right: 2px solid red;

  @media (max-width: 768px) {
    width: 100%;
    height: auto;
    border-right: none;
    border-bottom: 2px solid red;
    padding-bottom: 20px;

    img {
      max-width: 250px;
    }
  }

  @media (max-width: 480px) {
    img {
      max-width: 200px;
    }
  }

  &:hover img {
    transform: scale(1.1);
  }
`;

const Block2 = styled.div`
  height: 70%;
  padding: 50px 0px 20px 20px;
  width: 50%;
  display: flex;
  justify-content: center;
  flex-direction: column;

  @media (max-width: 768px) {
